class Node:
    def __init__(self, data, next=None):
        self.data = data
        self.next = next


class MyHashSet:

    def __init__(self):
        # The maximum value of a key is 10^6. n value is square root of 10^6.
        # The 'n' can be made dynamic, and the dynamic nature is not implemented as it is out of scope (as of now).
        self.n = 1000
        self.data = [None] * self.n

    def add(self, key: int) -> None:
        index = key % self.n
        if self.data[index] == None:
            self.data[index] = Node(key)
        else:
            def recursive(node):
                if node.data == key:
                    return node
                if node.next == None:
                    node.next = Node(key)
                    return node
                else:
                    node.next = recursive(node.next)
                    return node
            self.data[index] = recursive(self.data[index])
            return

    def remove(self, key: int) -> None:
        index = key % self.n
        def recursive(node):
            if node == None:
                return node
            if node.data == key:
                node.data = node.next
                return node.data
            else:
                node.next = recursive(node.next)
                return node

        self.data[index] = recursive(self.data[index])
        return


    def contains(self, key: int) -> bool:
        index = key % self.n

        def recursive(node):
            if node == None:
                return False
            elif node.data == key:
                return True
            else:
                return recursive(node.next)

        return recursive(self.data[index])


